import React from 'react';
import './WorkoutList.css';

const WorkoutList = ({ workout }) => {
  return (
    <div key={workout.workout_id} id='workout'>
      <div className='workout-title'>
        <h2 className='workout-title'>{workout.name}</h2>
      </div>
      <div className='template-section'>
        <p className='template-section-title'>Day Type</p>
        <p className='template-section-text'>{workout.day_type}</p>
      </div>
      <div className='template-section'>
        <p className='template-section-title'>Plan Type</p>
        <p className='template-section-text'>{workout.plan_type}</p>
      </div>
      <div className='template-section'>
        <p className='template-section-title'>Difficulty Level</p>
        <p className='template-section-text'>{workout.difficulty_level}</p>
      </div>
      <p className='workout-description'>
        Some details about the workout go here.
      </p>
    </div>
  );
};

export default WorkoutList;
